import { useState, useEffect } from "react";
import "../style/home.css";

import NavigationBar from "../component/navigationBar";
import Display from "../component/display";

function Home() {
	const page: string = "";

	function menuClickHandler(params: boolean) {
		let blurElement = document.getElementById("home_body_container")!;
		let menuElement = document.getElementById("side_menu")!;
		if (params) {
			blurElement.classList.remove("active");
			menuElement.classList.remove("active");
		} else {
			blurElement.classList.add("active");
			menuElement.classList.add("active");
		}
	}
	function navigate(params: string) {}

	return (
		<div className='home_container'>
			<NavigationBar func={menuClickHandler} data='Home' />
			<div>
				<div id='side_menu' className='side_menu'>
					<ul className='nav_menu'>
						<li
							onClick={() => changeUnderline("Collection")}
							id='Collection'
							className='Collection'
						>
							<a>Collection</a>
						</li>
						<li onClick={() => changeUnderline("Men")} id='Men' className='Men'>
							<a>Men</a>
						</li>
						<li
							onClick={() => changeUnderline("Women")}
							id='Women'
							className='Women'
						>
							<a>Women</a>
						</li>
						<li
							onClick={() => changeUnderline("About")}
							id='About'
							className='About'
						>
							<a>About</a>
						</li>
						<li
							onClick={() => changeUnderline("Contact")}
							id='Contact'
							className='Contact'
						>
							<a>Contact</a>
						</li>
						<div className='nav_underline'></div>
					</ul>
				</div>
			</div>
			<div id='home_body_container' className='home_body_container'>
				<Display />
			</div>
		</div>
	);
}

export default Home;
